import { faBell } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { Box_header, Container, Logo, Menu } from "./styled";

const Header_Home = () => {
    return (
        <>
            <Container>
                <Box_header>
                    <Logo src="/static/img/blockchain.png" />
                    <Menu>
                        <FontAwesomeIcon icon={farBr} />
                    </Menu>
                </Box_header>
            </Container>
        </>
    )
}

export default Header_Home;
